import React from 'react';
import {
  MDBContainer,
  MDBInput,
  MDBBtn
}
from 'mdb-react-ui-kit';
import { Link } from 'react-router-dom';
import { orange } from '@mui/material/colors';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

function Register() {
    const onSubmit = async (data) => {
        console.log(data);

        try {
            await axios.post(`${import.meta.env.VITE_API}/auth/login`, data, { withCredentials: true });
            await session.refresh();
            navigateTo('/');
        } catch(err) {
            setError('Netočna prijava');
        }
    };
  return (
    <MDBContainer className="p-3 my-5 d-flex flex-column w-50"  item container direction="row"style={{
        position: 'absolute', left: '50%', top: '55%',
        transform: 'translate(-50%, -50%)',
        border: '10px solid rgba(255, 165, 0, 0.5)',
        padding: '20px'
        }}>
    <p style= { { fontSize: 15 }}> Registracija</p>
    <div class="row">
    <p>Korisničko ime</p>
      <MDBInput wrapperClass='mb-4' id='form1' name = 'username' style={{height: '20px', width : '250px'}}/>
      <p>Ime</p>
      <MDBInput wrapperClass='mb-4' id='form1' name = 'name' style={{height: '20px', width : '250px'}}/>
    </div>
    <div class = "row">
    <p>Email</p>
      <MDBInput wrapperClass='mb-4' id='form1' name = 'email' style={{height: '20px', width : '250px'}}/>
      <p>Prezime</p>
      <MDBInput wrapperClass='mb-4' id='form1' name = 'surname' style={{height: '20px', width : '250px'}}/>
    </div>
    <div class = "row">
    <p>Lozinka</p>
      <MDBInput wrapperClass='mb-4' id='form2' type='password' name = 'password' style={{height: '20px', width : '250px'}}/>
      <p>Grad</p>
      <MDBInput wrapperClass='mb-4' id='form1' name = 'town' style={{height: '20px', width : '250px'}}/>
      <MDBBtn className="mb-4" style={{margin: '20px 0px'}}>Registracija</MDBBtn>
    </div>

    </MDBContainer>
  );
}

export default Register
